import './DashBoard.scss'
import { Tooltip,Legend,Bar, CartesianGrid, XAxis, YAxis, BarChart } from 'recharts';
const Dashboard = (props) => {
    const data = [
        {
            "day": "05-01",
            "temperature": [
                -1,
                10
            ]
        },
        {
            "day": "05-02",
            "temperature": [
                2,
                15
            ]
        },
        {
            "day": "05-03",
            "temperature": [
                3,
                12
            ]
        },
        {
            "day": "05-04",
            "temperature": [
                4,
                12
            ]
        },
        {
            "day": "05-05",
            "temperature": [
                12,
                16
            ]
        },
        {
            "day": "05-06",
            "temperature": [
                5,
                16
            ]
        },
        {
            "day": "05-07",
            "temperature": [
                3,
                12
            ]
        },
        {
            "day": "05-08",
            "temperature": [
                0,
                8
            ]
        },
        {
            "day": "05-09",
            "temperature": [
                -3,
                5
            ]
        }
    ]
    return (
        <div className="dashboard-container">
           <div className='title'>
                DashBoard
           </div>
           <div className='content'>
                <div className='c_left'>
                    <div className='child-content'>Total Users</div>
                    <div className='child-content'>Total Quiz</div>
                    <div className='child-content'> Total Questions</div>
                    <div className='child-content'>Total Answers</div>
                </div>
                <div className='c_right'>
                    <BarChart width={430} height={250} data={data}>
                        <CartesianGrid strokeDasharray="3 3" />
                        <XAxis dataKey="name" />
                        <YAxis />
                        <Tooltip />
                        <Legend />
                        <Bar dataKey="pv" fill="#8884d8" />
                        <Bar dataKey="uv" fill="#82ca9d" />
                    </BarChart>
                </div>
           </div>
        </div>
    )
}
export default Dashboard
